import React from 'react'
import { Link } from 'react-router-dom'
export default function MixTitle(props) {

    return (
        <div>
            <Link className='table_title' to='/'>{props.title}</Link>
            <p style={{ color: "#999" }}>
                {props.subTitle}
            </p>
        </div>
    )
}
